import satori from "satori";
import { Resvg } from "@resvg/resvg-js";
import fs from "fs/promises";
import parseFrontmatter from "gray-matter";
import slugify from "slugify";
import sharp from "sharp";

const svg = (title, avatarBase64) => ({
  type: "div",
  props: {
    children: [
      {
        type: "div",
        props: {
          style: {
            height: "100%",
            width: "100%",
            position: "absolute",
            zIndex: -1,
            backgroundColor: "#fdfdfd",
            backgroundImage: `url('data:image/png;base64,')`, // 🔁 Replace with full base64 PNG you shared
            backgroundSize: "cover",
            backgroundPosition: "center",
          },
        },
      },
      {
        type: "p",
        props: {
          children: title,
          style: {
            marginTop: 60,
            fontSize: 52,
            padding: 20,
            textAlign: "center",
            color: "#1a1a1a",
          },
        },
      },
      {
        type: "p",
        props: {
          children: [
            {
              type: "img",
              props: {
                src: avatarBase64,
                alt: "Yashd",
                width: 50,
                height: 50,
                style: {
                  borderRadius: "100%",
                  objectFit: "cover",
                  marginRight: 20,
                },
              },
            },
            "by yashd-dev",
          ],
          style: {
            display: "flex",
            padding: 10,
            alignItems: "center",
            color: "#444",
          },
        },
      },
    ],
    style: {
      height: "100%",
      width: "100%",
      display: "flex",
      position: "relative",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      fontSize: 22,
      fontWeight: 600,
    },
  },
});


async function generateSEOImages() {
  const outfit = await fs.readFile("./Outfit-Bold.ttf");
  const postsDirectory = "src/content/posts";
  const files = await fs.readdir(postsDirectory);

  // Load and resize the avatar image
  const avatarBuffer = await fs.readFile("public/images/white.jpg");
  const resizedAvatarBuffer = await sharp(avatarBuffer)
    .resize(50, 50)
    .toBuffer();
  const avatarBase64 = `data:image/jpeg;base64,${resizedAvatarBuffer.toString(
    "base64"
  )}`;

  for (const file of files) {
    const filePath = `${postsDirectory}/${file}`;
    const fileContent = await fs.readFile(filePath, "utf-8");
    const { data: frontmatter } = parseFrontmatter(fileContent);

    const output = await satori(svg(frontmatter.title, avatarBase64), {
      width: 1200,
      height: 430,
      fonts: [
        {
          name: "Outfit",
          data: outfit,
          weight: 700,
          style: "bold",
        },
      ],
    });

    const resvg = new Resvg(output, {
      fitTo: {
        mode: "width",
        value: 1200,
      },
    });

    const pngBuffer = resvg.render().asPng();

    const outputFileName = slugify(frontmatter.title, {
      lower: true,
      trim: true,
      remove: undefined,
    });

    await fs.writeFile(`public/og/${outputFileName}.png`, pngBuffer);
    console.log(`Generated SEO image for: ${frontmatter.title}`);
  }
}

generateSEOImages().catch(console.error);
